   .c-hamburger span:before {
    content:"";
    display:block;
    position:absolute;
    left:0;
    width:100%;
    height:2px;
    background-color:#fff
   }
   .c-hamburger span:before {
    top:-10px
   }
   .c-hamburger span:after {
    bottom:-10px
   }
